function crear(){
var imgData ='data:image/jpeg;base64,'

var doc = new jsPDF()

doc.setFontSize(40)

//dentro del parentesis(x, y, texto)
doc.text(35, 25, 'Ejemplo programa 11')

//dentro del parentesis(la variable de la imagen, el formato, x, y, ancho de la imgen, largo de la imagen)
doc.addImage(imgData, 'JPEG', 10, 40, 180, 110)


var nombre= document.getElementById('inputTexto').value

doc.text(35 , 40 , nombre)

//guardar el pdf
doc.save('ejemlo.pdf')

}